INSERT INTO `mqu_article` VALUES (1,6,3,'admin','小区物业公司评信用 南京巨盛51家&quot;小区管家&quot;上黑榜','','','&nbsp;2014年度南京物业企业信用征集情况今日公布，51家物业上黑榜，21家物业上红榜，其中有3家上黑榜的物业公司被扣分达到或超过15分，按规定在今年将无缘拿到诚信证明，从而被限制参与招投标。而在获得加分的物业...','<span style=\"margin:0px;padding:0px;border:0px;outline:0px;list-style:none;color:#000000;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;font-family:SimSun;font-size:14px;\"><span>&nbsp;</span>2014年度南京物业企业信用征集情况今日公布，51家物业上黑榜，21家物业上红榜，其中有3家上黑榜的物业公司被扣分达到或超过15分，按规定在今年将无缘拿到诚信证明，从而被限制参与招投标。而在获得加分的物业公司中，最高的一家公司被加了有30分之多。</span><br style=\"color:#000000;font-family:宋体, 微软雅黑, 黑体, Arial;font-size:12px;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;\" />\r\n<span style=\"margin:0px;padding:0px;border:0px;outline:0px;list-style:none;color:#000000;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;font-family:SimSun;font-size:14px;\"> 在信用欠佳的黑榜排名上，南京巨盛物业管理有限公司、高淳县金陶物业管理有限公司、南京清茳物业管理有限公司、南京中浩物业管理有限公司和南京金百庭物业管理有限公司这5家公司信用程度低，扣分均超过10分，更有三家物业公司的扣分超过了15分，最高的被扣了19分。按规定，扣分达到15分的，将由注册地区物业行政主管部门、街道办事处约谈企业法定代表人，责令其限期整改。整改期间，不予开具诚信证明，到下个记分周期结束前不得申报各类物业服务示范项目，取消参加行业各类先进评比表彰资格，不得晋升资质等级。此前南京已明确，参与新小区招投标时，必须亮出诚信档案，而无法取得诚信证明，则意味着几乎失去招投标资格。</span><br style=\"color:#000000;font-family:宋体, 微软雅黑, 黑体, Arial;font-size:12px;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;\" />\r\n<span style=\"margin:0px;padding:0px;border:0px;outline:0px;list-style:none;color:#000000;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;font-family:SimSun;font-size:14px;\"> 记者了解到，被扣19分的南京巨盛物业公司，目前管理金盛田铂宫小区和碧云山庄两个小区，其失分主要是因为碧云山庄出现毁绿事件并被媒体曝光；南京清茳物业管理的天润城第八街区，在市区两级检查中被扣8分，而公司未按时办理资质证书变更手续，又被扣7分。</span><br style=\"color:#000000;font-family:宋体, 微软雅黑, 黑体, Arial;font-size:12px;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;\" />\r\n<span style=\"margin:0px;padding:0px;border:0px;outline:0px;list-style:none;color:#000000;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;font-family:SimSun;font-size:14px;\"> 在红榜上，南京新鸿运物业管理公司得到了30分的加分，遥遥领先；其次是南京和谐物业管理有限责任公司，获得12分的加分；上海科瑞物业管理发展有限公司南京分公司加8分排第三。</span><br style=\"color:#000000;font-family:宋体, 微软雅黑, 黑体, Arial;font-size:12px;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;\" />\r\n<span style=\"margin:0px;padding:0px;border:0px;outline:0px;list-style:none;color:#000000;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;font-family:SimSun;font-size:14px;\"> 据悉，新鸿运管理的大多为写字楼项目，其中管理的苏美达五金工具总部公司因获评全国示范大厦而加了7分，还有项目获评省级城市物业管理优秀大厦、市级示范项目而加分，此外在全国及省级物业评奖中获奖也带来加分，还有保安拾金不昧、获得青奥组委会表扬信等也拿到了加分。</span><br style=\"color:#000000;font-family:宋体, 微软雅黑, 黑体, Arial;font-size:12px;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;\" />\r\n<span style=\"margin:0px;padding:0px;border:0px;outline:0px;list-style:none;color:#000000;font-style:normal;font-variant-ligatures:normal;font-variant-caps:normal;font-weight:normal;letter-spacing:normal;orphans:2;text-align:start;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;-webkit-text-stroke-width:0px;text-decoration-style:initial;text-decoration-color:initial;font-family:SimSun;font-size:14px;\"> 小区物业品质高低，已成为左右购房人的一大因素，而物业品质高，小区房源保值升值潜力相对也更大。当前，不少品牌开发商已成立自己的物业公司，以更好地对出售后的小区进行后续管理，这被业界喻为“上阵父子兵”。品牌房企相对充裕的资金实力以及管理能力，也的确让其物业能脱颖而出，此次上红榜的物业公司中，不少是品牌房企旗下的物业，如清风物业(高科旗下)、绿城物业、仁恒物业、五矿物业、中海物业、栖霞建设物业等。</span>','0','',0,1,1,0,0,'/xywg/show/1.html',4,1502700750,1502700787,'',1),(2,6,3,'admin','test','','','rhbsfnfqeh','rhbsfnfqeh','0','',0,1,1,0,0,'/xywg/show/2.html',0,1505095995,1505096006,'',1);
