INSERT INTO `mqu_block` VALUES (1,'fb01','底部地址版权电话',1,'<p>\r\n	全国服务电话：400-1022-315 &nbsp; &nbsp; &nbsp; 邮箱：zqxban@163.com\r\n</p>\r\n<p>\r\n	主办单位/版权所有：北京中企信办信息管理中心/中企信办信用建设工作委员会\r\n</p>\r\n<p>\r\n	地址：北京市海淀区西四环北路15号楼517室　 邮政编码：100097\r\n</p>\r\n<p>\r\n	京ICP备17046088号-3\r\n</p>','','','','',''),(2,'Itips','首页重要提示',1,'1、全国企业信用信息数据库(企业信用查询系统)内信息全部来源于各级主管部门和税务、质检、工商等各级机构信息，<span style=\"color:#E53333;\"><strong>北京中企信办信息管理中心</strong></span>对企业的资质、信用进行的综合评价。数据内所载的各种信息仅供参考，如搜索结果中存在不实信息，请您<strong><span style=\"color:#E53333;\">发起举报</span></strong>（经查实，可对企业信用产生影响）。<br />\r\n2、如有不法单位和个人通过全国企业信用信息数据库内信息资料，从而进行敲诈、勒索等犯罪活动将受法律制裁，<strong style=\"color:#E53333;white-space:normal;\">北京中企信办信息管理中心</strong>不承担相关责任；如利用该数据库内资料进行商业化运作导致的一切经济问题，管理中心不承担相关责任；如使用本平台查询企业资料，视为同意本声明。<br />\r\n3、查询相关企业信用信息时，请输入企业名称（按全称匹配），选择相应的企业查询类型（示范单位、重点单位、培育单位、信用编码），便可以查询到全国企业信用信息数据库内所收纳的企业信用数据信息。如企业名称涉及含有括号的情况，请注意全角半角区别。<br />\r\n<p>\r\n	4、全国企业信用信息数据库(企业信用查询系统)由中企信办信用建设工作委员会创建，网址：http://www.qgxy.org\r\n</p>\r\n<p>\r\n	指导文件：国发〔2014〕21号《国务院关于印发社会信用体系建设规划纲要（2014—2020年）的通知》，北京中企信办信息管理中心协办。\r\n</p>\r\n<p>\r\n	5、全国企业信用信息数据库&nbsp; 电话：400-1022-315&nbsp; 邮箱：zqxban@163.com\r\n</p>','','','','',''),(3,'ibg1','400电话图片',1,'','','','/Uploads/201711/59fbd77b75cf3.jpg','',''),(4,'creditblock','信用评级内页声明',1,'<div class=\"yinz\">\r\n	<span>*声明：<br />\r\n1、<span>指导文件：国发〔2014〕21号《国务院关于印发社会信用体系建设规划纲要（2014—2020年）的通知》</span><br />\r\n	<p>\r\n		2、本证书通过政府档案、关联或现场核实，并通过用户信息保护评估，本信用证书信息如有不实，欢迎<strong><a href=\"http://www.cccsi.org.cn/include/FeedBackAdd.asp\" target=\"_blank\">投诉举报</a></strong>；\r\n	</p>\r\n	<p>\r\n		3、本证书数据来源于信用联盟—全国企业信用信息数据库；官方网址：<span><a href=\"http://sjk.cccsi.org.cn\" target=\"_blank\">http://qgxy.org</a>；</span> \r\n	</p>\r\n	<p>\r\n		4、本证书一年例行核查一次，请企业每年按期联系本平台参加年检核实，联系电话：400-1022-315，年检邮箱：zqxban@163.com；\r\n	</p>\r\n	<p>\r\n		5、本证书仅供作为被信用评价企业的信用等级参考，不得作为其他商业合作的法律依据；\r\n	</p>\r\n	<p>\r\n		6、参照标准：《信用中介组织评价服务规范&nbsp;信用评级机构(GB/T&nbsp;22119-2008)》、《企业信用评价指标体系分类及代码(GB/T&nbsp;23794-2009)》。\r\n	</p>\r\n</span> \r\n</div>','','','','','');
