INSERT INTO `mqu_page` VALUES (3,'企业信用申请','','','','<p class=\"red font16\" style=\"color:red;\">\r\n	* 申报注意事项 *\r\n</p>\r\n<p>\r\n	1、企业申请内容请按照企业《营业执照》和《组织机构代码证》信息填写，确保完整无误；<br />\r\n2、企业类型分为：个人独资、有限责任公司、股份有限公司、集体所有制等；<br />\r\n3、所有带*的都为必填项目，其他为选填项目。日期格式：2017年06月20日<br />\r\n4、全国企业信用信息数据库由中企信办信用建设工作委员会主办<br />\r\n5、 指导单位：北京中企信办信息管理中心<br />\r\n6、企业信用报名电话：<br />\r\n400-1022-315 &nbsp; &nbsp;Email:zqxban@163.com<br />\r\n7、信用平台 交流合作：400-1022-315\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"red font16\" style=\"color:red;\">\r\n	* 欢迎合作交流 *\r\n</p>\r\n<p>\r\n	1、我们欢迎任何单位和个人与信用平台合作，共同为打造一个诚信的社会信用环境而努力。<br />\r\n2、只要你是愿意并且能够为国家的信用建设作出贡献，为全民的社会利益提供一份保障，我们都愿意与您竭诚合作。<br />\r\n3、合作的基础是数据和其它资源共享，愿意为对方提供工作上的方便，如宣传展示、推动相关的活动，为对方开放相应的接口等。<br />\r\n4、具体事项应在协商的基础上，签订相应的协议或者合同进行约束。<br />\r\n5、电话：400-1022-315    合作邮箱：Email：zqxban@163.com\r\n</p>','',0,'540*470',''),(7,'留言咨询','','','','','',0,'540*470','');
